import React from "react";
import "./UserCard.css"

const UserCard = () => {
    return (
        <div>
            <h1>User Card</h1>
            <div className="parent">
            <div className="chil-1">
                <img src="./avatar3.png" alt="Avatar" />
            </div>
            <div className="child-2">
                <h3>Name</h3>
                <p>Username</p>
                <p>Email</p>
            </div>
            </div>
        </div>
    );
};

export default UserCard;
